import React from "react";
import NavBar from "./NAVBAR/NavBar";
import SectionOne from "./SECTIONONE/SectionOne";
import { Card } from "../UI/Card.styled";
import SectionThree from "./SECTIONTHREE/SectionThree";
import Form from "./FORMSECTION/Form";

const HomePage = ({ fontSizes, UI, colors }) => {
  return (
    <>
      <Card bg={colors.bgColor}>
        <NavBar fontSizes={fontSizes} UI={UI} colors={colors} />
        <SectionOne fontSizes={fontSizes} UI={UI} colors={colors}></SectionOne>
        <SectionThree fontSizes={fontSizes} UI={UI} colors={colors} />
        <Form fontSizes={fontSizes} UI={UI} colors={colors} />
        <Card ta={"center"} mg={"8rem 0"}>
          Copyright Â© 2019 Company Name . All rights reserved
        </Card>
        <Card ta={"center"} mg={"0rem 0"}>
          Designed by Tooplate
        </Card>
      </Card>
    </>
  );
};

export default HomePage;
